import React from 'react';


function CoinList({ coins }) {
    //console.log("55",);
    return (
        <div>
            {
                coins.map(coin => (
                    <div>
                        {Object.keys(coin)}
                    </div>
                ))
            }
        </div>
    )
};

export default CoinList;
